import React from 'react';
import './App.css';
import Tasks from './xample/tasks.json';

class App extends React.Component {

  state = {
    tasks: Tasks
  }

  render() {
    return <div>
      { this.state.tasks.map(response => <ul><li>(response.task)</li></ul>) }
    </div>
  }
}

export default App;
